Updating nested MongoDB documents is not working<p>I'm trying to create update functionality for nested documents in a MongoDB app, but coming from my update function I get &quot;Cannot read properties of undefined (reading 'updateOne')&quot; in the browser. That example is for updateOne, but it happens for every mongoose method I've tried.</p>
<p>The function:</p>
<pre><code>function update(req, res) {
  Employee.labs.updateOne({_id: req.params.id}, {
    reactPh: req.body.reactPh,
    pH: req.body.pH,
    temperature: req.body.temperature,
    dissOx: req.body.dissOx,
    ammonia: req.body.ammonia,
    date: req.body.date,
  })
  Employee.labs.save(function(err) {
    res.redirect('/labs')
  })
}
</code></pre>
<p>&quot;Employee&quot; is the name of the schema/model, and the &quot;labs&quot; schema is embedded into it.</p>
<p>I've been using mongoose methods to create, index, show, delete these same subdocs with no such issues.</p>
<p>Here is the form action with one of the fields:</p>
<pre><code>&lt;form action=&quot;/labs/&lt;%= lab._id %&gt;?_method=PUT&quot; method=&quot;POST&quot;&gt;

  &lt;label&gt;Reactive phosphorous:
    &lt;input type =&quot;number&quot; step=&quot;0.01&quot; name=&quot;reactPh&quot; value=&quot;&lt;%= lab.reactPh %&gt;&quot;&gt;
  &lt;/label&gt;&lt;br&gt;
</code></pre>
<p>Any help is much appreciated!</p>
<p>Employee schema (one employee object to many lab objects):</p>
<pre><code>var mongoose = require('mongoose');

var labSchema = new mongoose.Schema({
    reactPh: Number,
    pH: Number,
    temperature: Number,
    dissOx: Number,
    ammonia: Number,
    date: Date,
})

var employeeSchema = new mongoose.Schema({
    name: String,
    email: String,
    labs: [labSchema],
    googleId: String
})


module.exports = mongoose.model('Employee', employeeSchema);
</code></pre>
<p><strong>UPDATE:</strong>
Using Luiz's code and a couple small changes in referencing, it now works. Here it is:</p>
<pre><code>function update (req, res) {
  Employee.updateOne({ _id: req.body.employeeId, 'labs._id': req.params.id },
    { $set: {
      'labs.$.reactPh': req.body.reactPh,
      'labs.$.pH': req.body.pH,
      'labs.$.temperature': req.body.temperature,
      'labs.$.dissOx': req.body.dissOx,
      'labs.$.ammonia': req.body.ammonia,
      'labs.$.date': req.body.date,
  }}, (err) =&gt; {
      res.redirect('/labs');
  })
}
</code></pre>

