<p>The first scenario I thought of was perhaps the check is for if the user was trying to reset their password and the check is to see if the &quot;new password&quot; matched the &quot;db password,&quot; but that didn't make sense because the password would be stored as a hash. So now I'm at a loss.</p>
<pre><code>schema.pre(&quot;save&quot;, async function(next) {

  if (!this.isModified(&quot;password&quot;)) {
    return next();
  }


  try {
    const salt = await bcrypt.genSalt(10);
    let hashedPassword = await bcrypt.hash(this.password, salt);
    this.password = hashedPassword;
    return next();
  } catch (error) {
    return next(error);
  }
});
</code></pre>; Answer: Apparently, presto maps Cassandra `timeuuid` type to VARCHAR, and presto doesn't support the Cassandra  minTimeuuid function. Presto should invite extensions that better supports `timeuuid` and the `minTimeuuid` function. If extending presto isn't a desirable option, then you'd need to explore some other alternatives, such as adding a `timestamp` column, which presto does support. Or, implementing a function that mimics the Cassandra minTimeuuid function (returning an equivalent value), and using that value in the Cassandra query...  `created_time > 'mygenerateduuidvalue'`.

